            <FeatureCard>
              <Icon>ü§ù</Icon>
              <h3>Ïã†Î¢∞Ìï† Ïàò ÏûàÎäî ÌååÌä∏ÎÑà</h3>
              <p>
                Ïû•Í∏∞Ï†ÅÏù∏ ÌååÌä∏ÎÑàÏã≠ÏùÑ ÌÜµÌï¥ ÏßÄÏÜçÏ†ÅÏù∏ ÏÑ±Í≥µÏùÑ 
